library IEEE;
use IEEE.STD_LOGIC_1164.ALL;
use ieee.std_logic_arith.all;
use ieee.std_logic_unsigned.all;
use IEEE.NUMERIC_STD.ALL;

-- 800*600@60Hz VGA Display, input clk = 40 Mhz

entity VGA is
Generic(
    LinePeriod      : integer := 1056;  --Periods each line
    H_SyncPulse     : integer := 128;   --a
    H_BackPorch     : integer := 88;    --b
    H_ActivePix     : integer := 800;   --c
    H_FrontPorch    : integer := 40;    --d
    
    FramePeriod     : integer := 628;   --Periods each frame
    V_SyncPulse     : integer := 4;     --f
    V_BackPorch     : integer := 23;    --g
    V_ActivePix     : integer := 600;   --h
    V_FrontPorch    : integer := 1      --i
);
Port (
    -- Input
    RESET           : in std_logic;
    CLK              : in std_logic;
    TOUCH         : in std_logic;
    START           : in std_logic;
    -- Output
    vga_hs          : out std_logic;
    vga_vs          : out std_logic;
    vga_r           : out std_logic_vector(3 downto 0);
    vga_g           : out std_logic_vector(3 downto 0);
    vga_b           : out std_logic_vector(3 downto 0);
    
    crash           : out std_logic;
    
    AN_TOP      : out std_logic_vector(7 downto 0);
    CONTROL_TOP : out std_logic_vector(6 downto 0)
);
end VGA;

architecture Behavioral of VGA is
    signal x_cnt        : integer range 0 to LinePeriod;    --Current x
    signal y_cnt        : integer range 0 to FramePeriod;   --Current y
    signal data         : integer range 0 to 4095;         --12-bit Color Space
    
    signal vga_r_reg    : std_logic_vector(3 downto 0);     --4-bit red reg
    signal vga_g_reg    : std_logic_vector(3 downto 0);     --4-bit green reg
    signal vga_b_reg    : std_logic_vector(3 downto 0);     --4-bit blue reg
    signal data_reg     : std_logic_vector(11 downto 0);    --12-bit data reg
    
    signal hsync_r      : std_logic;
    signal vsync_r      : std_logic;
    signal h_dis     : std_logic;
    signal v_dis     : std_logic;
    
    signal crash_reg, crash_next : std_logic;
    
    signal clk_40M, clk_100m, c_lock1, c_lock2 : std_logic;
    component clk_wiz_100m_40m
        port (clk_in, reset : in std_logic;
                clk_40m, locked : out std_logic);
    end component;
    
    signal height : integer range 0 to 469;
    component bird is
        Port (btn : in std_logic; -- Tap-tap
                start : in std_logic; -- Start a new game
                clk    : in std_logic; -- 100MHz system clock
                reset  : in std_logic;
                height : out integer range 0 to 469);
    end component bird;
    
    signal gap1, gap2 : integer range 0 to 399;
    signal pos1, pos2 : integer range 0 to 799;
    signal pos1_reg, pos2_reg : integer range 0 to 799;
    signal dis1, dis2 : std_logic;
    signal width1, width2 : integer range 0 to 200;
    component pillar is
        Port(btn : in std_logic;
                ng : in std_logic;
                clk    : in std_logic;
                reset  : in std_logic;
                gap1 : out integer range 0 to 399;
                gap2 : out integer range 0 to 399;
                pos1 : out integer range 0 to 799;
                pos2 : out integer range 0 to 799;
                dis1, dis2 : out std_logic);
    end component pillar;
    
    signal restart : std_logic;
    component button is
    Port (btn : in std_logic;
            clk    : in std_logic;
            reset  : in std_logic;
            pulse  : out std_logic);
    end component button;
    
    signal score_reg, score_next, best_reg, best_next : std_logic_vector(7 downto 0);
    component anode is
    Port (CLK : in std_logic;
            A, B : in std_logic_vector(7 downto 0);
            AN: out std_logic_vector(7 downto 0);
            CONTROL : out std_logic_vector(6 downto 0));
    end component anode;
    
    signal gameover : std_logic_vector(479999 downto 0);
    
begin
    -- 40Mhz clk generation
    CLK1_GEN_INST : clk_wiz_100m_40m
    port map(clk_in => CLK, 
                    reset => '0',
                    clk_40m => clk_40m,
                    locked => c_lock1);
                    
    bird_inst : bird
    port map(btn => TOUCH,
                    start => START,
                    clk => clk,
                    reset => RESET,
                    height => height);
                    
    obstacles : pillar
    port map(btn => TOUCH,
                    ng => START,
                    clk => clk,
                    reset => RESET,
                    gap1 => GAP1,
                    pos1 => POS1,
                    gap2 => GAP2,
                    pos2 => POS2,
                    dis1 => DIS1,
                    dis2 => DIS2);
        
    new_game : button
    port map( 
        btn => START,
        reset => RESET,
        clk => CLK,
        pulse => restart);
        
    score : anode
    port map(
        CLK => CLK,
        A => score_reg,
        B => best_reg,
        AN => AN_TOP,
        CONTROL => CONTROL_TOP);

    -- Data sync
    process(clk_40m, RESET)
    begin
        if RESET = '1' then
            vga_r_reg <= (others => '0');
            vga_g_reg <= (others => '0');
            vga_b_reg <= (others => '0');
        elsif rising_edge(clk_40m) then
            vga_r_reg <= data_reg(11 downto 8);
            vga_g_reg <= data_reg(7 downto 4);
            vga_b_reg <= data_reg(3 downto 0);
        end if;
    end process;

    process(clk_40m)
    begin
        if rising_edge(clk_40m) then
            --Move of current x
            if RESET = '1' then
                x_cnt <= 1;
            elsif x_cnt = LinePeriod then
                x_cnt <= 1;
            elsif RESET = '0' then
                x_cnt <= x_cnt + 1;
            end if;
            --Move of current y
            if RESET = '1' then
                y_cnt <= 1;
            elsif y_cnt = FramePeriod then
                y_cnt <= 1;
            elsif x_cnt = LinePeriod then
                y_cnt <= y_cnt + 1;
            end if;
        end if;
    end process;

    -- Horizontal sync
    process(clk_40m)
    begin
        if rising_edge(clk_40m) then
            if RESET = '1' then
                hsync_r <= '1';
            elsif x_cnt = 1 then
                hsync_r <= '0';
            elsif x_cnt = H_SyncPulse then
                hsync_r <= '1';
            end if;
        end if ;
    end process;
    -- Horizontal display
    process(clk_40m)
    begin
        if rising_edge(clk_40m) then
            if RESET='1' then
                h_dis <= '0';
            elsif x_cnt = H_SyncPulse + H_BackPorch then
                h_dis <= '1';
            elsif x_cnt = H_syncPulse + H_BackPorch + H_ActivePix then
                h_dis <= '0';
            end if;
        end if ;
    end process;

    -- Vertical sync
    process(clk_40m)
    begin
        if rising_edge(clk_40m) then
            if RESET = '1' then
                vsync_r <= '1';
            elsif y_cnt = 1 then
                vsync_r <= '0';
            elsif y_cnt = V_SyncPulse then
                vsync_r <= '1';
            end if;
        end if ;
    end process;
    -- Vertical display
    process(clk_40m)
    begin
        if rising_edge(clk_40m) then
            if RESET='1' then
                v_dis <= '0';
            elsif y_cnt = V_SyncPulse + V_BackPorch then
                v_dis <= '1';
            elsif y_cnt = V_SyncPulse + V_BackPorch + V_ActivePix then
                v_dis <= '0';
            end if;
        end if ;
    end process;

    -- Connect reg to ports
    -- Red
    with (h_dis and v_dis) select
    vga_r <= vga_r_reg when '1',
                    "0000"     when '0';
    -- Green
    with (h_dis and v_dis) select
    vga_g <= vga_g_reg when '1',
                    "0000"       when '0';
    -- Blue
    with (h_dis and v_dis) select
    vga_b <= vga_b_reg when '1',
                    "0000"       when '0';
    -- Sync signal
    vga_hs <= hsync_r;
    vga_vs <= vsync_r;          
    crash <= crash_reg;         
    
     -- Game display
    process(clk_40m)
    begin
        -- Game over
        if (crash_reg = '1') then
            if gameover(800 * (y_cnt - V_SyncPulse - V_BackPorch) + x_cnt - H_SyncPulse - H_BackPorch) = '0' then
                data <= 16#FFF#;
            else
                data <= 16#000#;
            end if;
        -- Gaming
        elsif falling_edge(clk_40m) then
            -- Bird
            if (x_cnt > H_SyncPulse + H_BackPorch + 220 and x_cnt < H_SyncPulse + H_BackPorch  + 250) and
                (y_cnt > V_SyncPulse + V_BackPorch + height and y_cnt < V_SyncPulse + V_BackPorch + height + 30) then
                data <= 16#D82#;
            -- Pillar 1
            elsif (dis1 = '1') and (x_cnt > H_SyncPulse + H_BackPorch + pos1 and x_cnt < H_SyncPulse + H_BackPorch  + pos1 + 20) and
                    (y_cnt < V_SyncPulse + V_BackPorch + gap1 or y_cnt > V_SyncPulse + V_BackPorch + gap1 + 200) then
                data <= 16#9E6#;
            elsif (dis1 = '1') and (x_cnt >= H_SyncPulse + H_BackPorch + pos1 + 20 and x_cnt < H_SyncPulse + H_BackPorch  + pos1 + 80) and
                    (y_cnt < V_SyncPulse + V_BackPorch + gap1 or y_cnt > V_SyncPulse + V_BackPorch + gap1 + 200) then
                data <= 16#7B3#;
            elsif (dis1 = '1') and (x_cnt >= H_SyncPulse + H_BackPorch + pos1 + 80 and x_cnt < H_SyncPulse + H_BackPorch  + pos1 + 100) and
                    (y_cnt < V_SyncPulse + V_BackPorch + gap1 or y_cnt > V_SyncPulse + V_BackPorch + gap1 + 200) then
                data <= 16#582#;
            -- Pillar 2
            elsif (dis2 = '1') and (x_cnt > H_SyncPulse + H_BackPorch + pos2 and x_cnt < H_SyncPulse + H_BackPorch  + pos2 + 20) and
                    (y_cnt < V_SyncPulse + V_BackPorch + gap2 or y_cnt > V_SyncPulse + V_BackPorch + gap2 + 200) then
                data <= 16#9E6#;
            elsif (dis2 = '1') and (x_cnt >= H_SyncPulse + H_BackPorch + pos2 + 20 and x_cnt < H_SyncPulse + H_BackPorch  + pos2 + 80) and
                    (y_cnt < V_SyncPulse + V_BackPorch + gap2 or y_cnt > V_SyncPulse + V_BackPorch + gap2 + 200) then
                data <= 16#7B3#;
            elsif (dis2 = '1') and (x_cnt >= H_SyncPulse + H_BackPorch + pos2 + 80 and x_cnt < H_SyncPulse + H_BackPorch  + pos2 + 100) and
                    (y_cnt < V_SyncPulse + V_BackPorch + gap2 or y_cnt > V_SyncPulse + V_BackPorch + gap2 + 200) then
                data <= 16#582#;
            -- Sky
            elsif y_cnt < V_SyncPulse + V_BackPorch + 400 then
                data <= 16#6CC#;
            -- Buildings
            elsif y_cnt < V_SyncPulse + V_BackPorch + 500 then
                data <= 16#EFD#;
            -- Ground
            else
                data <= 16#DD9#;
            end if;
        end if;
    end process;
    
    -- Crash detect
    process(clk_40m)
    begin
        if RESET = '1' then
            crash_reg <= '0';
        elsif START = '1' then
            crash_reg <= '0';
        elsif rising_edge(clk_40m) then
            crash_reg <= crash_next;
        end if;
    end process;
    
    process(clk_40m)
    begin
        crash_next <= crash_reg;
        if height >= 469 then
            crash_next <= '1';
        elsif (dis1 = '1') and (pos1 > 120 and pos1 < 250) and (height < gap1 or height + 30 > gap1 + 200) then
            crash_next <= '1';
        elsif (dis2 = '1') and (pos2 > 120 and pos2 < 250) and (height < gap2 or height + 30 > gap2 + 200) then
            crash_next <= '1';
        end if;
    end process;
    
    -- Score record
    process(clk_40m)
    begin
        if RESET = '1' then
            score_reg <= (others => '0');
            best_reg <= (others => '0');
            pos1_reg <= 0;
            pos2_reg <= 0;
        elsif START = '1' then
            score_reg <= (others => '0');
            pos1_reg <= 0;
            pos2_reg <= 0;
        elsif rising_edge(clk_40m) then
            score_reg <= score_next;
            best_reg <= best_next;
            pos1_reg <= pos1;
            pos2_reg <= pos2;
        end if;
    end process;
    
    process(clk_40m)
    begin
        score_next <= score_reg;
        best_next <= best_reg;
        if (crash_reg = '1') and (score_reg > best_reg) then
            best_next <= score_reg;
        end if;
        if (crash_reg = '0') and (dis1 = '1') and (pos1 = 119) and (pos1_reg = 120) then
            score_next <= score_reg + 1;
        elsif (crash_reg = '0') and (dis2 = '1') and (pos2 = 119) and (pos2_reg = 120) then
            score_next <= score_reg + 1;
        end if;
    end process;
    
    data_reg <= conv_std_logic_vector(data, 12);
--    gameover <= (others => '0');
    gameover <= "";

end Behavioral;
